"mw-headline" id="Music">Music</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Fine&amp;action=edit&amp;section=2" title="Edit section: Music">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Glossary_of_musical_terminology#F" title="Glossary of musical terminology">Fine</a>, an Italian word used mostly in classical music</li> <li><a href="/wiki/Fine_(band)" title="Fine (band)">Fine (band)</a>, a short-lived late 1990s American band</li> <li><a href="/wiki/Fine_(album)" title="Fine (album)"><i>Fine</i> (album)</a>, a 1994 album by Snailhouse</li> </ul> <h3><span class="mw-headline" id="Songs">Songs</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Fine&amp;action=edit&amp;section=3" title="Edit section: Songs">edit</a><span class="mw-editsection-bracket">]</span></span></h3> <ul> <li><a href="/wiki/Fine_(Taeyeon_song)" title="Fine (Taeyeon song)">"Fine" (Taeyeon song)</a></li> <li><a href="/wiki/Fine_(Whitney_Houston_song)" title="Fine (Whitney Houston song)">"Fine" (Whitney Houston song)</a></li> <li>"<a href="/wiki/F.I.N.E.*" title="F.I.N.E.*">F.I.N.E.*</a>", a 1993 song by Aerosmith</li> <li>"Fine", by James from the album <i><a href="/wiki/Pleased_to_Meet_You_(James_album)" title="Pleased to Meet You (James album)">Pleased to Meet You</a></i></li> <li>"Fine", by Kylie Minogue from the album <i><a href="/wiki/Kiss_Me_Once" title="Kiss Me Once">Kiss Me Once</a></i></li> <li>"Fine", by Prism from the album <i><a href="/wiki/Beat_Street_(album)" title="Beat Street (album)">Beat Street</a></i></li> </ul> <h2><span class="mw-headline" id="People">People</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Fine&amp;action=edit&amp;section=4" title="Edit section: People">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Fine_(surname)" title="Fine (surname)">Fine (surname)</a></li> </ul> <h2><span class="mw-headline" id="Fictional_characters">Fictional characters</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Fine&amp;action=edit&amp;section=5" title="Edit section: Fictional characters">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Fran_Fine" class="mw-redirect" title="Fran Fine">Fran Fine</a>, the title character of <i>The Nanny</i></li> <li><a href="/wiki/Sylvia_Fine_(The_Nanny)" class="mw-redirect" title="Sylvia Fine (The Nanny)">Sylvia Fine (The Nanny)</a>, Fran's mother on <i>The Nanny</i></li> </ul> <h2><span class="mw-headline" id="Acronym">Acronym</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Fine&amp;action=edit&amp;section=6" title="Edit section: Acronym">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/FINE" title="FINE">FINE</a>, an informal association of the four main Fair Trade networks</li> <li><a href="/wiki/FINE_(printing)" class="mw-redirect" title="FINE (printing)">FINE (printing)</a>, a print head technology used in Canon printers</li> </ul> <h2><span class="mw-headline" id="Other_uses">Other uses</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/w/index.php?title=Fine&amp;action=edit&amp;section=7" title="Edit section: Other uses">edit</a><span class="mw-editsection-bracket">]</span></span></h2> <ul> <li><a href="/wiki/Fine,_New_York" title="Fine, New York">Fine, New York</a>, a town in the United States</li> <li>A term for the purity of precious metals - see <a href="/wiki/Fineness" title="Fineness">Fineness</a></li> <li>Fine, an attribute of certain <a href="/wiki/Fielding_(cricket)#Fielding_position_names_and_locations" title="Fielding (cricket)">cricket fielding positions</a></li> <li><a href="/wiki/Fine_(drink)"